import axios from "axios";
import HamburgerMenu from "../components/HamburgerMenu";
import PhotoGrid from "../components/PhotoGrid";
import { useEffect, useState } from "react";

const Home = () => {
    const [photo, setPhoto] = useState();
    useEffect(() => {
        const fetchPhoto = () => {
            axios
                .get(
                    `https://api.unsplash.com/photos/random?query=sky&count=10&client_id=zGwHr3YQJnRC6tCv91uPIeRX5XTg9pgHs-oGoOKq69o`
                )
                .then((res) => {
                    if (JSON.stringify(photo) !== JSON.stringify(res.data)) {
                        setPhoto(res.data);
                        console.log(res.data);
                    }
                });
        };
        fetchPhoto();
    }, []);

    return (
        <div className="app-container">
            <div className="sidebar">
                <HamburgerMenu menu1="MyPage" menu2="Logout" />
            </div>
            <div className="content">
                {photo && < PhotoGrid photos={photo} />}
            </div>
        </div>
    );
};
export default Home;
